import React from 'react';
import NavBar from '../components/NavBar'
import { Button } from '@mui/material';
import { authFetch } from '../auth/AuthFunctions'

class Home extends React.Component {

    constructor(props) {
        super(props);
        this.testTripCreation = this.testTripCreation.bind(this);
        this.testProtected = this.testProtected.bind(this);
        this.testCookie = this.testCookie.bind(this);
    }

    testProtected() {
        authFetch('api/protected').then(resp => console.log(resp));
    }

    testCookie() {
        fetch('api/login_required').then(resp => console.log(resp));
    }

    testTripCreation() {
        const data = {};
        data['method'] = 'POST';
        data['body'] = JSON.stringify({
            token: 'token'
        });
        data['headers'] = {
            'Content-Type': 'application/json'
        };
        authFetch('/api/trips/create', data).then(resp => console.log(resp));

    }

    render() {
        return (
            <div>
                <NavBar />
                <h2>Home Page</h2>
                <Button onClick={() => this.testProtected()}>Test Protected</Button>
                <Button onClick={() => this.testTripCreation()}>Create Trip</Button>
                <Button onClick={() => this.testCookie()}>Test Cookie</Button>
            </div>
        )
    }
}

export default Home;
